import React, { useState, useEffect } from "react";
import Card from "./components/Card";
import Select from "./components/Select";
import getBreeds from "./helpers/getBreeds";

const initialBreeds = {
	image:
		"https://s2.glbimg.com/KQHZY5vQlfXO-UNru4waLHW6tzI=/e.glbimg.com/og/ed/f/original/2019/01/19/49345147_10157219683333254_4289793586985172992_o.jpg",
	breed: {
		id: 1,
		name: "Labrador",
	},
};

function App() {
	const [dog, setDog] = useState(initialDog);

	useEffect(() => {
		updateBreeds();
	}, []);

	const updateBreeds = () => {
		getBreeds()
			.then((newBreeds) => {
				setBreeds(newBreeds);
			})
			.catch(console.log("Erro"));
	};

	return (
		<div className='App'>
			<Select />
			<Card dog={dog} />
		</div>
	);
}

export default App;
